import React, { useState } from 'react';
// import '../Style/Employee.css';
import "../Style/EmployeeForm.css"
import { useNavigate,useParams,Link } from 'react-router-dom';
import axios from 'axios';
import { toast } from 'react-toastify';
// import { Toast } from 'react-toastify/dist/components';


const EmployeeForm = () => {

  const [formData, setFormData] = useState({
    name: '',
    department: '',
    experience: '',
    startdate: '',
    manager: '',
    skills: '',
    remarks: '',
  });

  const {name,department,experience,startdate,manager,skills,remarks}= formData;

  const handleInputChange = (event) => {
    const { name, value } = event.target;
    setFormData((prevData) => ({ ...prevData, [name]: value }));
  };


const handleSubmit = async (event) => {
    event.preventDefault();

    if(!name || !department || !experience || !startdate || !manager || !skills || !remarks) {
      toast.error("please enter your details");

} 
else {
  axios.post("http://localhost:5000/api/post",{
    name,
    department,
    experience,
    startdate,
    manager,
    skills,
    remarks,
    
  }).then(()=>{
    setFormData({
    name: '',
    department: '',
    experience: '',
    startdate: '',
    manager: '',
    skills: '',
    remarks: '',
    })
    .catch((err)=> toast.erro)
  })
}
};
    // try {
    //   const response = await fetch('/api/addEmployee', {
    //     method: 'POST',
    //     headers: {
    //       'Content-Type': 'application/json',
    //     },
    //     body: JSON.stringify(formData),
    //   });
  
    //   if (response.ok) {
    //     const data = await response.json();
    //     console.log(data.message);
    //   } else {
    //     console.error('Error adding employee');
    //   }
    // } catch (error) {
    //   console.error('Error:', error);
    // }
  // };
  

  return (
    <div className="form-container">  
      <h1>Employee Details</h1>
      <form onSubmit={handleSubmit}>
       
       
        <label htmlFor="name">Name:</label>
        <input type="text" id="name" name="name" value={formData.name} onChange={handleInputChange} required />

        <label htmlFor="department">Department:</label>
        <input type="text" id="department" name="department" value={formData.department} onChange={handleInputChange} required />

        <label htmlFor="experience">Total Experience:</label>
        <input type="number" id="experience" name="experience" value={formData.experience} onChange={handleInputChange} required />

        <label htmlFor="start-date">Starting Date:</label>
        <input type="date" id="startdate" name="startdate" value={formData.startdate} onChange={handleInputChange} required />

        <label htmlFor="manager">Manager:</label>
        <input type="text" id="manager" name="manager" value={formData.manager} onChange={handleInputChange} required />

        <label htmlFor="skills">Skills:</label>
        <textarea type="text" id="skills" name="skills" rows="4" value={formData.skills} onChange={handleInputChange} required></textarea>

        <label htmlFor="remarks">Remarks:</label>
        <textarea type="text" id="remarks" name="remarks" rows="4" value={formData.remarks} onChange={handleInputChange}></textarea>



        <button type="submit">Submit</button>
     
     <Link to="/">

        <input type='button' value="Go Back"/>
     </Link>
      </form>
    </div>
  );
};

export default EmployeeForm;




